var setEventUserId = setTimeout(function () {
    if (document.readyState === "complete") {
        callEventUserId();
    }
}, 500);

function callEventUserId() {
    clearInterval(setEventUserId);
    var txt = document.getElementsByName("User")[0];
    txt.onblur = function (e) {
        console.log("User id accessed on blur");
        if (e.target.value) {
            sessionStorage.setItem("userId", e.target.value);
            captureRoleAndEnv(e.target.value, function (err, role) {
                if (err) {
                    console.log("Error in Service");
                } else {
                    sessionStorage.setItem("role", role);
                }
            });
        }
    };
    if (sessionStorage.getItem("userId") == null) {
        txt.onfocus = function (e) {
            console.log("User id accessed on select");
            if (e.target.value) {
                sessionStorage.setItem("userId", e.target.value);
                captureRoleAndEnv(e.target.value, function (err, role) {
                    if (err) {
                        console.log("Error in Service");
                    } else {
                        sessionStorage.setItem("role", role);
                    }
                });
            }
        };
    } else if (sessionStorage.getItem("userId") == null) {
        txt.onLoad = function (e) {
            console.log("User id accessed on load");
            if (e.target.value) {
                sessionStorage.setItem("userId", e.target.value);
                captureRoleAndEnv(e.target.value, function (err, role) {
                    if (err) {
                        console.log("Error in Service");
                    } else {
                        sessionStorage.setItem("role", role);
                    }
                });
            }
        };
    }
}

//-------------S:USER ROLE SERVICE CALL--------------- 
function captureRoleAndEnv(userId, callback) {
    var xhr = new XMLHttpRequest();
    const url =
        "https://nis-dev.nynas.com/Chatbot_FetchUserRoleFromNOWService?UserID=" +
        userId;
    xhr.open("GET", url);
    xhr.onreadystatechange = function () {
        if (xhr.readyState === 4) {
            if (xhr.status === 200) {
                var data = JSON.parse(xhr.responseText);
                console.log(data.UserRole);
                callback(null, data.UserRole);
            } else {
                console.error("Service Down " + xhr.statusText);
                console.log("Error ", xhr);
                console.log("Error Res", xhr.responseText);
            }
        }
    };
    xhr.onerror = function (e) {
        console.error("Service Down." + xhr.statusText);
        console.log("Error ", xhr);
        console.log("Error Res", xhr.responseText);
    };
    xhr.send(null);
}
